import React from 'react';
import "./main.css"

export class Main extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            array : [1, 2, 3, 2, 1],
            desiredSweetness: 6,
            no : []
        }}

    getDesiredSweetness(){
        let desiredSweetness = this.state.desiredSweetness;
        let array = this.state.array;
        let sum = 0
        let fArray = []
        for(let i = 0; i < array.length; i++){
            sum+=array[i]
            console.log("sum",sum)
            if(sum <= desiredSweetness){
                console.log("i-",i)
                fArray.push(i)
                this.state.no = fArray
                console.log(this.state.no,"no---->")
                return this.state.no
            }
        }
    }

    componentDidMount(){
        this.getDesiredSweetness()
    }
    
    render()
    {
        return(
            <div className="header">hello</div>
        )
    }
}
